import{_ as e,a as s,o as a,W as t}from"./chunks/framework.CJwJD4JI.js";const _=JSON.parse('{"title":"wsl2中docker启动不了的问题解决方法","description":"","frontmatter":{"title":"wsl2中docker启动不了的问题解决方法","categories":"杂谈日记","date":"2023-04-22 22:46","tags":["wsl"]},"headers":[],"relativePath":"posts/杂谈日记/2023/wsl2中docker启动不了的问题解决方法.md","filePath":"posts/杂谈/5.wsl2中docker启动不了的问题解决方法/README.md","lastUpdated":1723020021000}'),p={name:"posts/杂谈日记/2023/wsl2中docker启动不了的问题解决方法.md"},o=t(`<p>在wsl2的ubuntu系统中安装docker后，<code>sudo service docker start</code> 一直启动不起来</p><p>在网上找到了解决方案</p><blockquote><p><a href="https://juejin.cn/post/7197594278083919932" target="_blank" rel="noreferrer">https://juejin.cn/post/7197594278083919932</a></p></blockquote><h1 id="解决方法" tabindex="-1">解决方法 <a class="header-anchor" href="#解决方法" aria-label="Permalink to &quot;解决方法&quot;">​</a></h1><p>这个错误提示通常是因为系统中使用的是经过修改的 nftables，而 Docker 安装程序使用 iptables 进行 NAT。为了解决这个问题，您可以使用以下命令将系统切换回使用传统的 iptables：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>sudo update-alternatives --set iptables /usr/sbin/iptables-legacy</span></span>
<span class="line"><span>sudo update-alternatives --set ip6tables /usr/sbin/ip6tables-legacy</span></span></code></pre></div><p>该命令将 <code>/usr/sbin/iptables-legacy</code> 和 <code>/usr/sbin/ip6tables-legacy</code> 分别设置为 iptables 和 ip6tables 的备选方案。</p><p>然后，您可以尝试重新启动 Docker 守护进程（如果尚未运行）：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>sudo service docker start</span></span></code></pre></div><p>现在，Docker 应该已经能够正常工作了！</p>`,10),c=[o];function l(i,n,r,d,u,b){return a(),s("div",null,c)}const k=e(p,[["render",l]]);export{_ as __pageData,k as default};
